INSERT INTO `block_custom` VALUES (1,'<div>\r\n<a href=\"/dieei/computer-engineering\"><img src=\"/dieei/computer-engineering/sites/default/files/images/logo_ing_inf_new.png\" width=\"350\"></a>\r\n</div>','logo','full_html'),(2,'<div class=\"navbar navbar-inverse navbar-fixed-top\">\r\n      <div class=\"container-fluid\">\r\n        <div class=\"navbar-collapse collapse\">\r\n          <ul class=\"nav navbar-nav navbar-nav2 navbar-left\">\r\n            <li><a href=\"#\">Students</a></li>\r\n            <li><a href=\"#\">Faculty</a></li>\r\n            <li><a href=\"#\">Staff</a></li>\r\n            <li><a href=\"/dieei/past-graduates\">Alumni</a></li>\r\n            <li><a href=\"#\">Parents</a></li>\r\n            <li><a href=\"#\">Visitors</a></li>\r\n           <li><a href=\"/dieei/computer-engineering/search\">DIEEIsearch <i style=\"margin-left:2px;\" class=\"glyphicon glyphicon-search white\"></i> \r\n</a></li>\r\n<li><a href=\"/dieei/computer-engineering/user\">MyDIEEI <span style=\"margin-left:3px;\" class=\"glyphicon glyphicon-lock white\"></span>\r\n</a></li>\r\n          </ul>\r\n        </div>\r\n      </div>\r\n    </div>','Top Menu New','full_html'),(3,' <div class=\"bottom\">\r\n        <div class=\"container\">\r\n            <div class=\"col-md-2\">\r\n                <!--<h3><span class=\"glyphicon glyphicon-heart\"></span> Footer section 1</h3>-->\r\n<br>\r\n                <ul class=\"list-unstyled\">\r\n<li><a href=\"#\">Students</a></li>\r\n<li>Faculty</li>\r\n<li>Staff</li>\r\n<li>Alumni</li>\r\n<li>Parents</li>\r\n<li>Visitors</li>\r\n</ul>\r\n            </div>\r\n            <div class=\"col-md-2\">\r\n                <!--<h3><span class=\"glyphicon glyphicon-star\"></span> Footer section 2</h3>-->\r\n<br>\r\n                <ul class=\"list-unstyled\">\r\n<li>Directories</li>\r\n<li>Maps</li>\r\n<li>Quick Links</li>\r\n<li>MyDIEEI</li>\r\n<li>Community</li>\r\n</ul>\r\n            </div>\r\n            <div class=\"col-md-4\" align=\"center\">\r\n                <!--<h3><span class=\"glyphicon glyphicon-music\"></span> Footer section 3</h3>-->\r\n<br>\r\n                <div class=\"bottom_opacity\"><a href=\"#\"><img width=\"200\" src=\"/dieei/sites/default/files/images/unict_white.png\"></a><br><br><img src=\"/dieei/sites/default/files/images/icons_social/twitter.png\">  <img src=\"/dieei/sites/default/files/images/icons_social/github.png\">  <img src=\"/dieei/sites/default/files/images/icons_social/email.png\">  <img src=\"/dieei/sites/default/files/images/icons_social/skype.png\"></div></p>\r\n<br>\r\n            </div>\r\n            <div class=\"col-md-2\">\r\n               <!-- <h3><span class=\"glyphicon glyphicon-star\"></span> Footer section 2</h3> -->\r\n<br>\r\n                <ul class=\"list-unstyled\">\r\n<li>Job Opportunities</li>\r\n<li>Stages</li>\r\n<li>Tutoring</li>\r\n<li>Workshops</li>\r\n<li>Businesses</li>\r\n<li>Labs</li>\r\n</ul>\r\n            </div>\r\n            <div class=\"col-md-2\">\r\n                <!--<h3><span class=\"glyphicon glyphicon-star\"></span> Footer section 2</h3>-->\r\n<h3 class=\"glyphicon glyphicon-heart white\"> DIEEI</h3>\r\n<ul class=\"list-unstyled\"><li>Università di Catania</li><li>Viale Andrea Doria, 33</li><li>95100, Catania (IT)</li><li>General: 800 644 590</li><li>Students: 800 894 327</li></ul>\r\n            </div>\r\n        </div>\r\n\r\n    </div>','footer','full_html'),(4,'<div id=\"carousel-example-generic\" class=\"carousel slide\" data-ride=\"carousel\">\r\n        <!-- Indicators -->\r\n        <ol class=\"carousel-indicators\">\r\n          <li data-target=\"#carousel-example-generic\" data-slide-to=\"0\" class=\"\"></li>\r\n          <li data-target=\"#carousel-example-generic\" data-slide-to=\"1\" class=\"\"></li>\r\n          <li data-target=\"#carousel-example-generic\" data-slide-to=\"2\" class=\"active\"></li>\r\n<!--<li data-target=“#carousel-example-generic“ data-slide-to=\"3\" class=\"\"></li>-->\r\n        </ol> \r\n        <!-- Wrapper for slides -->\r\n        <div class=\"carousel-inner\">\r\n          <div class=\"item active\">\r\n            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel1.png\" alt=\"Apple iPhone 5S\">\r\n            <div class=\"carousel-caption\">\r\n             <h3>Apple iPhone 5S</h3>\r\n              <p>The iPhone 5s isn\'t a radical departure from its predecessor in body (unless you count a new gold color), but under the hood are a number of changes that give Apple\'s newest flagship some real firepower, with the best still yet to come. </p>\r\n            </div>\r\n          </div>\r\n\r\n<div class=\"item\">\r\n            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel2.png\" alt=\"Innovation\">\r\n            <div class=\"carousel-caption\">\r\n             <h3>Innovation generates Entreprises</h3>\r\n              <p>UniCT Innovation Exchange is building a startup \'ecosystem\' on city\'s South Side</p>\r\n            </div>\r\n          </div>\r\n\r\n          <div class=\"item\">\r\n            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel3.png\" alt=\"Samsung Galaxy Note 3\">\r\n            <div class=\"carousel-caption\">\r\n<p>Similar to the updates Samsung made to the Galaxy S4, the new Note 3 features a bigger display while remaining very similar in size to the Note II; the biggest change in the Note 3 is the refinement of the S Pen and its accompanying software.</p>\r\n            </div>\r\n          </div>\r\n\r\n         <!-- <div class=\"item\">\r\n            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel3.png\" alt=\"Apple iPhone 5S\">\r\n            <div class=\"carousel-caption\">\r\n              <h3>Sony Xperia Z1</h3>\r\n              <p>Sony\'s got a plan and it\'s sticking to it - while other makers pile software feature upon feature, the Japanese focus on their historical strengths, such as beautiful, durable design, photographic excellence and enviable display tech. That in short is what the Xperia Z1 is all about.</p>\r\n            </div>\r\n          </div>-->\r\n        </div>\r\n\r\n        <!-- Controls \r\n        <a class=\"left carousel-control\" href=\"#carousel-example-generic\" data-slide=\"prev\">\r\n          <span class=\"glyphicon glyphicon-chevron-left\"></span>\r\n        </a>\r\n        <a class=\"right carousel-control\" href=\"#carousel-example-generic\" data-slide=\"next\">\r\n          <span class=\"glyphicon glyphicon-chevron-right\"></span>\r\n        </a>-->\r\n      </div>','Carousel','full_html');
