mativi e delle basi di dati. Le linee di ricerca attuali hanno un carattere fortemente interdisciplinare e si collocano nell seguenti aree: 1) Knowledge Management e Knowledge Discovery (con impiego di tecnologie semantiche per la fusione e l\'analisi di dati eterogenei) 2) Image/signal processing and pattern recognition (in ambito biomedico e per il monitoraggio ambientale) 3) Sistemi Cognitivi e human-computer interaction (con particolare riferimento all\'informatica medica e allo studio dei processi percettivi e cognitivi di alto livello). Per la sua attività scientifica, documentata da più di 150 pubblicazioni su riviste e atti di convegni, ha ricevuto diversi premi e riconoscimenti internazionali. Fra questi, si segnala il \"Prix d\'excellence du CIPTE - Canada\" per la migliore tesi di Ph.D. in Educational Technology (per rigore metodologico e originalità). Progetti di ricerca europei: 2005 - 2007	Coordinatore scientifico del progetto “I-TRACE: Interactive Tracing and Graphical Annotation in Pen-based e-learning” (rif. N. 223434-CP-1-2005-1-IT-MINERVA-MPP). Leading a consortium of 7 european partners. Research focus: innovative learning systems based on multimodal interaction, with key demonstrators in the medical field http://www.itrace.ing.unict.it 2009 - now	Responsabile scientifico dell\'unità di ricerca dell\'Università di Catania nell\'ambito del progetto “mEDUCATOR”: Multitype content sharing and repurposing in medical education (research programme: eContentPLUS). The project is a Best Practice Network that investigates content sharing technologies in medicine and “Health Science” (www.meducator.net) 2010 - now	Responsabile scientifico dell\'unità di ricerca dell\'Università di Catania nell\'ambito del progetto “Fish4Knowledge”: Supporting humans in knowledge gathering and question answering w.r.t. marine and environmental monitoring through analysis of multiple video streams (Research Framework FP7, funding Scheme: STREP; Objective: ICT-2009-4.3: Intelligent Information Management) (www.fish4knowledge.eu) Responsabile dei seguenti progetti di ricerca universitari locali/italiani (finanziati dal MIUR e dal Ministero per l\'innovazione tecnologica): 2006 - now Data mining tools for knowledge discovery in bio and neuroinformatics 2007- 2008	“Content retrieval” assisted by eye-tracking: tools and methodologies 2005 - 2006	Image processing and pattern recognition in multimodal systems 2003 - 2004	Image processing and pattern recognition in multimedia systems Membro dei comitati di programma di numerose conferenze internazionali: 2009 - now IEEE ITAB: IEEE International Conference on Information Technology Applications in Biomedicine. 2009 - now	IEEE CBMS: International Symposium on Computer-based Medical Systems (special track on Technology Enhanced Learning in Medical Education) 2007 - 2008	GRIDCAD: Workshop on Grid Computing Applications Development. 2009 - now	WMUTE - IEEE International Conference on Wireless, Mobile and Ubiquitous Technologies in Education. 2009 - now	CUMTEL Int. Workshop on “Classroom, Ubiquitous, and Mobile Technologies Enhanced Learning, within ICCE (Int. Conference on Computers in Education) 2007 Co-chair and organizer of the 1st Int. Workshop on Pen-based Learning Technologies (PLT 2007). In Technical Cooperation with IEEE Computer Society, Proceedings published in CD-ROM and in the IEEE CS Digital Library Dal 2013 fa parte come Invited Expert del Working Group sui Learning Objects di Medbiquitous, organo internazionale (ANSI accredited) per la standardizzazione dell\'Information Technology nelle Health Professions. Daniela Giordano è membro dell\'IEEE (in particolare dell\' IEEE Computer Society e della Systems, Man and Cybernetics Society), e dell\'ACM (special interest group on Human-Computer Interaction)\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:13:\"filtered_html\";s:10:\"safe_value\";s:5039:\"<p>Daniela Giordano ha conseguito nel 1990 la Laurea in Ingegneria Elettronica presso l\'Università di Catania. Nel 1995 e nel 1998 ha conseguito, rispettivamente, il Master of Arts e il Ph.D. in Educational Technology presso la Concordia University di Montreal. Nel triennio 1997-2000 è stata prima professore a contratto di Modeling and Simulation alla Concordia University di Montreal, e poi professore a contratto di Sistemi di Elaborazione presso la Facoltà di Ingegneria di Catania. Dal 2001 è Professore Associato nel settore Ing-Inf/05 (Sistemi di Elaborazione delle Informazioni) e afferisce al Dipartimento di Ingegneria Elettrica, Elettronica e Informatica dell\'Università di Catania. Dal 2013 è Presidente del Corso di Laurea Magistrale in Ingegneria Informatica, dove tiene il corso \"Sistemi Cognitivi e Interazione Persona-Calcolatore\". Ha iniziato l\'attività scientifica occupandosi di logiche temporali per la simulazione di sistemi interattivi e successivamente di tecnologie multimediali per l\'apprendimento nel settore della progettazione dei sistemi informativi e delle basi di dati. Le linee di ricerca attuali hanno un carattere fortemente interdisciplinare e si collocano nell seguenti aree: 1) Knowledge Management e Knowledge Discovery (con impiego di tecnologie semantiche per la fusione e l\'analisi di dati eterogenei) 2) Image/signal processing and pattern recognition (in ambito biomedico e per il monitoraggio ambientale) 3) Sistemi Cognitivi e human-computer interaction (con particolare riferimento all\'informatica medica e allo studio dei processi percettivi e cognitivi di alto livello). Per la sua attività scientifica, documentata da più di 150 pubblicazioni su riviste e atti di convegni, ha ricevuto diversi premi e riconoscimenti internazionali. Fra questi, si segnala il \"Prix d\'excellence du CIPTE - Canada\" per la migliore tesi di Ph.D. in Educational Technology (per rigore metodologico e originalità). Progetti di ricerca europei: 2005 - 2007	Coordinatore scientifico del progetto “I-TRACE: Interactive Tracing and Graphical Annotation in Pen-based e-learning” (rif. N. 223434-CP-1-2005-1-IT-MINERVA-MPP). Leading a consortium of 7 european partners. Research focus: innovative learning systems based on multimodal interaction, with key demonstrators in the medical field <a href=\"http://www.itrace.ing.unict.it\">http://www.itrace.ing.unict.it</a> 2009 - now	Responsabile scientifico dell\'unità di ricerca dell\'Università di Catania nell\'ambito del progetto “mEDUCATOR”: Multitype content sharing and repurposing in medical education (research programme: eContentPLUS). The project is a Best Practice Network that investigates content sharing technologies in medicine and “Health Science” (<a href=\"http://www.meducator.net\">www.meducator.net</a>) 2010 - now	Responsabile scientifico dell\'unità di ricerca dell\'Università di Catania nell\'ambito del progetto “Fish4Knowledge”: Supporting humans in knowledge gathering and question answering w.r.t. marine and environmental monitoring through analysis of multiple video streams (Research Framework FP7, funding Scheme: STREP; Objective: ICT-2009-4.3: Intelligent Information Management) (<a href=\"http://www.fish4knowledge.eu\">www.fish4knowledge.eu</a>) Responsabile dei seguenti progetti di ricerca universitari locali/italiani (finanziati dal MIUR e dal Ministero per l\'innovazione tecnologica): 2006 - now Data mining tools for knowledge discovery in bio and neuroinformatics 2007- 2008	“Content retrieval” assisted by eye-tracking: tools and methodologies 2005 - 2006	Image processing and pattern recognition in multimodal systems 2003 - 2004	Image processing and pattern recognition in multimedia systems Membro dei comitati di programma di numerose conferenze internazionali: 2009 - now IEEE ITAB: IEEE International Conference on Information Technology Applications in Biomedicine. 2009 - now	IEEE CBMS: International Symposium on Computer-based Medical Systems (special track on Technology Enhanced Learning in Medical Education) 2007 - 2008	GRIDCAD: Workshop on Grid Computing Applications Development. 2009 - now	WMUTE - IEEE International Conference on Wireless, Mobile and Ubiquitous Technologies in Education. 2009 - now	CUMTEL Int. Workshop on “Classroom, Ubiquitous, and Mobile Technologies Enhanced Learning, within ICCE (Int. Conference on Computers in Education) 2007 Co-chair and organizer of the 1st Int. Workshop on Pen-based Learning Technologies (PLT 2007). In Technical Cooperation with IEEE Computer Society, Proceedings published in CD-ROM and in the IEEE CS Digital Library Dal 2013 fa parte come Invited Expert del Working Group sui Learning Objects di Medbiquitous, organo internazionale (ANSI accredited) per la standardizzazione dell\'Information Technology nelle Health Professions. Daniela Giordano è membro dell\'IEEE (in particolare dell\' IEEE Computer Society e della Systems, Man and Cybernetics Society), e dell\'ACM (special interest group on Human-Computer Interaction)</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:12:\"field_phone_\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:12:\"095 7382371 \";s:6:\"format\";N;s:10:\"safe_value\";s:12:\"095 7382371 \";}}}s:10:\"field_mail\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:32:\"daniela.giordano@dieei.unict.it \";s:6:\"format\";N;s:10:\"safe_value\";s:32:\"daniela.giordano@dieei.unict.it \";}}}s:11:\"field_photo\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"1\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:6:\"83.jpg\";s:3:\"uri\";s:17:\"public://83_0.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:4:\"2929\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1403705348\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:2:\"96\";s:6:\"height\";s:2:\"96\";}}}s:13:\"field_qualify\";a:1:{s:3:\"und\";a:1:{i:0;a:1:{s:5:\"value\";s:20:\"Professore associato\";}}}}',0,1403707522,1),('field:node:6','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1317:\"<div class=\"row\">\r\n<div class=\"col-md-4\">\r