mg src=\"/dieei/sites/default/files/images/icons_social/email.png\" /><img src=\"/dieei/sites/default/files/images/icons_social/skype.png\" /></div>\n\n<p><br /></p></div>\n<div class=\"col-md-2\">\n<!-- <h3><span class=\"glyphicon glyphicon-star\"></span> Footer section 2</h3> --><p><br /></p>\n<ul class=\"list-unstyled\"><li>Job Opportunities</li>\n<li>Stages</li>\n<li>Tutoring</li>\n<li>Workshops</li>\n<li>Businesses</li>\n<li>Labs</li>\n</ul></div>\n<div class=\"col-md-2\">\n<!--<h3><span class=\"glyphicon glyphicon-star\"></span> Footer section 2</h3>--><h3 class=\"glyphicon glyphicon-heart white\"> DIEEI</h3>\n<ul class=\"list-unstyled\"><li>Università di Catania</li>\n<li>Viale Andrea Doria, 33</li>\n<li>95100, Catania (IT)</li>\n<li>General: 800 644 590</li>\n<li>Students: 800 894 327</li>\n</ul></div>\n</div>\n</div>\n',0,1403706997,0),('full_html::8761e0e88ad9bd2565b6d5bae0a14b3408cba5be057e350921938e7d9983b327','<div>\n<a href=\"/dieei/computer-engineering\"><img src=\"/dieei/computer-engineering/sites/default/files/images/logo_ing_inf_new.png\" width=\"350\" /></a>\n</div>\n',0,1403706997,0),('full_html::d84f1a73112d54df9e57115924eb956e32c4c42b6dc683270871d3010e7bd6f6','<div id=\"carousel-example-generic\" class=\"carousel slide\" data-ride=\"carousel\">\n<!-- Indicators --><ol class=\"carousel-indicators\"><li data-target=\"#carousel-example-generic\" data-slide-to=\"0\" class=\"\"></li>\n<li data-target=\"#carousel-example-generic\" data-slide-to=\"1\" class=\"\"></li>\n<li data-target=\"#carousel-example-generic\" data-slide-to=\"2\" class=\"active\"></li>\n<!--<li data-target=“#carousel-example-generic“ data-slide-to=\"3\" class=\"\"></li>--></ol><!-- Wrapper for slides --><div class=\"carousel-inner\">\n<div class=\"item active\">\n            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel1.png\" alt=\"Apple iPhone 5S\" /><div class=\"carousel-caption\">\n<h3>Apple iPhone 5S</h3>\n<p>The iPhone 5s isn\'t a radical departure from its predecessor in body (unless you count a new gold color), but under the hood are a number of changes that give Apple\'s newest flagship some real firepower, with the best still yet to come. </p>\n</div>\n</div>\n<div class=\"item\">\n            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel2.png\" alt=\"Innovation\" /><div class=\"carousel-caption\">\n<h3>Innovation generates Entreprises</h3>\n<p>UniCT Innovation Exchange is building a startup \'ecosystem\' on city\'s South Side</p>\n</div>\n</div>\n<div class=\"item\">\n            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel3.png\" alt=\"Samsung Galaxy Note 3\" /><div class=\"carousel-caption\">\n<p>Similar to the updates Samsung made to the Galaxy S4, the new Note 3 features a bigger display while remaining very similar in size to the Note II; the biggest change in the Note 3 is the refinement of the S Pen and its accompanying software.</p>\n</div>\n</div>\n<!-- <div class=\"item\"><p>            <img src=\"http://188.226.254.198/dieei/sites/default/files/carousel_images/carousel3.png\" alt=\"Apple iPhone 5S\"></p>\n<div class=\"carousel-caption\">\n<h3>Sony Xperia Z1</h3>\n<p>Sony\'s got a plan and it\'s sticking to it - while other makers pile software feature upon feature, the Japanese focus on their historical strengths, such as beautiful, durable design, photographic excellence and enviable display tech. That in short is what the Xperia Z1 is all about.</p>\n</div>\n</div>\n<p>-->\n        </div>\n<!-- Controls \n        <a class=\"left carousel-control\" href=\"#carousel-example-generic\" data-slide=\"prev\"><p>          <span class=\"glyphicon glyphicon-chevron-left\"></span><br />\n        </a><br />\n        <a class=\"right carousel-control\" href=\"#carousel-example-generic\" data-slide=\"next\"><br />\n          <span class=\"glyphicon glyphicon-chevron-right\"></span><br />\n        </a>-->\n      </div>\n',0,1403708234,0);
