INSERT INTO `field_data_body` VALUES ('node','page',0,2,2,'und',0,'TODO','','full_html'),('node','page',0,3,3,'und',0,'todo','','full_html'),('node','page',0,4,4,'und',0,'TODO','','full_html'),('node','teacher_',0,5,5,'und',0,'Daniela Giordano ha conseguito nel 1990 la Laurea in Ingegneria Elettronica presso l\'Università di Catania. Nel 1995 e nel 1998 ha conseguito, rispettivamente, il Master of Arts e il Ph.D. in Educational Technology presso la Concordia University di Montreal. Nel triennio 1997-2000 è stata prima professore a contratto di Modeling and Simulation alla Concordia University di Montreal, e poi professore a contratto di Sistemi di Elaborazione presso la Facoltà di Ingegneria di Catania. Dal 2001 è Professore Associato nel settore Ing-Inf/05 (Sistemi di Elaborazione delle Informazioni) e afferisce al Dipartimento di Ingegneria Elettrica, Elettronica e Informatica dell\'Università di Catania. Dal 2013 è Presidente del Corso di Laurea Magistrale in Ingegneria Informatica, dove tiene il corso \"Sistemi Cognitivi e Interazione Persona-Calcolatore\". Ha iniziato l\'attività scientifica occupandosi di logiche temporali per la simulazione di sistemi interattivi e successivamente di tecnologie multimediali per l\'apprendimento nel settore della progettazione dei sistemi informativi e delle basi di dati. Le linee di ricerca attuali hanno un carattere fortemente interdisciplinare e si collocano nell seguenti aree: 1) Knowledge Management e Knowledge Discovery (con impiego di tecnologie semantiche per la fusione e l\'analisi di dati eterogenei) 2) Image/signal processing and pattern recognition (in ambito biomedico e per il monitoraggio ambientale) 3) Sistemi Cognitivi e human-computer interaction (con particolare riferimento all\'informatica medica e allo studio dei processi percettivi e cognitivi di alto livello). Per la sua attività scientifica, documentata da più di 150 pubblicazioni su riviste e atti di convegni, ha ricevuto diversi premi e riconoscimenti internazionali. Fra questi, si segnala il \"Prix d\'excellence du CIPTE - Canada\" per la migliore tesi di Ph.D. in Educational Technology (per rigore metodologico e originalità). Progetti di ricerca europei: 2005 - 2007	Coordinatore scientifico del progetto “I-TRACE: Interactive Tracing and Graphical Annotation in Pen-based e-learning” (rif. N. 223434-CP-1-2005-1-IT-MINERVA-MPP). Leading a consortium of 7 european partners. Research focus: innovative learning systems based on multimodal interaction, with key demonstrators in the medical field http://www.itrace.ing.unict.it 2009 - now	Responsabile scientifico dell\'unità di ricerca dell\'Università di Catania nell\'ambito del progetto “mEDUCATOR”: Multitype content sharing and repurposing in medical education (research programme: eContentPLUS). The project is a Best Practice Network that investigates content sharing technologies in medicine and “Health Science” (www.meducator.net) 2010 - now	Responsabile scientifico dell\'unità di ricerca dell\'Università di Catania nell\'ambito del progetto “Fish4Knowledge”: Supporting humans in knowledge gathering and question answering w.r.t. marine and environmental monitoring through analysis of multiple video streams (Research Framework FP7, funding Scheme: STREP; Objective: ICT-2009-4.3: Intelligent Information Management) (www.fish4knowledge.eu) Responsabile dei seguenti progetti di ricerca universitari locali/italiani (finanziati dal MIUR e dal Ministero per l\'innovazione tecnologica): 2006 - now Data mining tools for knowledge discovery in bio and neuroinformatics 2007- 2008	“Content retrieval” assisted by eye-tracking: tools and methodologies 2005 - 2006	Image processing and pattern recognition in multimodal systems 2003 - 2004	Image processing and pattern recognition in multimedia systems Membro dei comitati di programma di numerose conferenze internazionali: 2009 - now IEEE ITAB: IEEE International Conference on Information Technology Applications in Biomedicine. 2009 - now	IEEE CBMS: International Symposium on Computer-based Medical Systems (special track on Technology Enhanced Learning in Medical Education) 2007 - 2008	GRIDCAD: Workshop on Grid Computing Applications Development. 2009 - now	WMUTE - IEEE International Conference on Wireless, Mobile and Ubiquitous Technologies in Education. 2009 - now	CUMTEL Int. Workshop on “Classroom, Ubiquitous, and Mobile Technologies Enhanced Learning, within ICCE (Int. Conference on Computers in Education) 2007 Co-chair and organizer of the 1st Int. Workshop on Pen-based Learning Technologies (PLT 2007). In Technical Cooperation with IEEE Computer Society, Proceedings published in CD-ROM and in the IEEE CS Digital Library Dal 2013 fa parte come Invited Expert del Working Group sui Learning Objects di Medbiquitous, organo internazionale (ANSI accredited) per la standardizzazione dell\'Information Technology nelle Health Professions. Daniela Giordano è membro dell\'IEEE (in particolare dell\' IEEE Computer Society e della Systems, Man and Cybernetics Society), e dell\'ACM (special interest group on Human-Computer Interaction)\r\n','','filtered_html'),('node','page',0,6,6,'und',0,'<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<p align=\"center\"><img src=\"http://www.informatics-europe.org/images/logos/logo-informatics-europe.png\" height=\"100\"></p>\r\n<p align=\"justify\">\r\nInformatics Europe is the association of computer science departments and research laboratories in Europe and neighbouring areas. The mission of the association is to foster the development of quality research and teaching in information and computer sciences, also known as Informatics.\r\n</p>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<p align=\"center\"><img src=\"http://static.guim.co.uk/sys-images/Guardian/Pix/pictures/2011/5/11/1305104203366/Europe-flag-007.jpg\" height=\"100\" class=\"img-roundes\"></p>\r\n<p align=\"justify\">Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.</p>\r\n</div>\r\n<div class=\"col-md-4\">\r\n<p align=\"center\"><img src=\"http://unict.llpmanager.it/immagini/catania_logo.gif\" height=\"100\"></p>\r\n<blockquote>\r\n  <p>Placeat providere et privilegium concedere quod Studium generale fiat in Civitate Cathanie, cum civitas sit ad hoc aptissima et fertilis. Placet</p>\r\n  <footer>Alfonso d\'Aragona - 1434</footer>\r\n</blockquote>\r\n</div>\r\n</div>','','full_html'),('node','course',0,7,7,'und',0,'Parte I: Principi di base dell’interaction design: elementi, leggi, e caratteristiche di un buon interaction design. Usabilità dei sistemi interattivi. Linee guida, principi e teorie. I design pattern per l\'interazione. Usabilità universale.','','filtered_html');
